package Strings;
import java.util.*;
public class example1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		Scanner sc=new Scanner(System.in);
		int m=4;
		int n=5;
		 
		
		for( int i=1;i<=n;i++) {
			for( int j=1;j<=m;j++) {
				System.out.print("*");
			}
			System.out.println();
		}
	}

}
